import { INCREMENT, DECREMENT, RESET } from "./ActionTypes";
export const fazetelincrement = () => {
  return { type: INCREMENT };
};
export const DecrementHandler = () => {
  return { type: DECREMENT };
};
export const ResetHandler = () => {
  return { type: RESET };
};
